import { Container, Navbar, Nav, NavDropdown } from 'react-bootstrap';
import "../styles/navbar.scss";
import logo from "../images/Logo.svg";
import sign from "../images/Sign.svg";
import {

  Routes,
  Route,
  Link
} from "react-router-dom";

import {Home} from "./pages/Home.js";

export default function NavbarComponent() {
  return (
      <Navbar collapseOnSelect expand="lg" bg="light" >
        <Container>
          <Navbar.Brand Link to = "/"><img className="logo" src={logo} alt="logo" /></Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link to = "/movies" >Movies</Nav.Link>
              <Nav.Link to = "/news" >News</Nav.Link>
            </Nav>
            <Nav className="logs">
              <span><img className="sign" src={sign} alt="sing in/up"/></span>
              <Nav.Link id="signin" href="#deets">Sign in</Nav.Link>
              <span className="bar">/</span>
              <Nav.Link id="signup" href="#memes">Sign up</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
  );
}
